import React from 'react'
import Button from '@material-ui/core/Button';
class Card extends React.Component {
    render() {
        const {data} = this.props;
        return (
            <>
                {
                    data.map((item, index) => (
                        <div className="card" key={index}>
                            <div>
                                <h2>{item.title}</h2>
                            </div>
                            <img  src={item.src} alt=""/>
                            <img  src={item.src} alt=""/>
                            <div>
                                <p>{item.description}</p>
                                <Button  variant="contained" color="primary" onClick={() => { alert('C\' est toi le/la meilleure') }}>Click me</Button>
                            </div>
                            <div>
                                <small className="text-muted" variant="contained" color={"primary"}>Last updated 3 mins ago</small>
                            </div>
                        </div>
                    ))
                }
            </>
        )
    }
}

export default  Card;
